const style = `
.header {
  height: 50vh;
  width: 100%;
  background: url(https://media.giphy.com/media/ZcdJJvDqTgdGZK8Xd3/giphy.gif) repeat center;
  background-size: cover;
  display: flex;
}

.name {
  color: white;
  justify-content: center;
  alight
}
`;

const Header = () => {
  return (
    <div className="header">
      <style>{style}</style>
      <h1 className="name">Mark Vincent Go</h1>
    </div>
  );
};

export default Header;
